const AddExpenseButton = (props) => {
  const clickHandeler = () => {
    console.log(this);
    props.onBtnClick(false);
  };
  return (
    <button onCLick={clickHandeler} className="add-new-expense-btn">
      Add New Expense
    </button>
  );
};
export default AddExpenseButton;
